import React from "react";

export default function Main() {
  return (
    <>
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>負傷名</th>
            <th>負傷日</th>
            <th>初検日</th>
            <th>終了日</th>
            <th>転帰</th>
            <th>原因</th>
          </tr>
        </thead>
      </table>
    </>
  );
}
